import React from 'react'

function Navegation() {
  const list=['Examenes','Pacientes','Registro']
  return (
    <div className='w-2/12 bg-green-primary'>
        <ol>
            {list.map(elemet=><li className='p-2 text-center text-xl'>{elemet}</li>)}
        </ol>
    </div>
  )
}

export default Navegation
